Movie Info: Atharintiki Daaredi (English: What is the way to mother-in-law's house?) is a 2013 Telugu comedy-drama film directed by Trivikram Srinivas starring Pawan Kalyan and Samantha in lead roles. The film was produced by BVSN Prasad under Sri Venkateswara Cine Chitra banner. Devi Sri Prasad scored the soundtrack for the film. It was released on September 27, 2013.

